import React from 'react';
import {StyledHeader} from '../styles/StyledHeader';

const Header = () => {
    return (
    <StyledHeader>
        <div>
            <div>
                <h2>POLKADOT BLOCK EXPLORER</h2>
            </div>           
        </div>
    </StyledHeader>
    )
};

export default Header;
